INSERT INTO `scholarship` (`s_id`, `s_title`, `s_link`, `s_detail`) VALUES
(1, 'The Velammal Science Talent Search Exam', 'http://www.velammalsciencetalenttest.com/index.html', 'Conducted by The Velammal Educational Trust of Tamil Nadu, the objective of the scholarship test is to identify students with potential to study and support them with cash rewards. The total scholarship prize on offer is Rs. 4 lakhs across 6 different levels. Its an exam where you can put your aptitude and problem solving skills to test and stand a good chance of winning a prize from one among the 30 prizes in each level.Students of Class I to XII in Tamil Nadu or Pondicherry are eligible to write this exam.'),
(2, 'NTSE', 'http://www.ncert.nic.in/programmes/talent_exam/talent3.html', 'This is a well-known scholarship for students studying in their 10th standard. Other than being a very prestigious scholarship that boosts the resume of its winners, it also provides Rs.1250/month for 11th, 12th standard students and ?2000 for undergraduates and postgraduates. This is offered to a total of 1000 students in a year. The exams of NTSE are known to be rigorous and involve multiple stage written exams. There are dedicated coaching centers that cater to the needs of NTSE aspirants which testifies to the amount of competition for this scholarship.'),
(3, 'Kishore Vaigyanik Protsahan Yojana (KVPY)', 'http://www.kvpy.iisc.ernet.in/main/index.html', 'The Kishore Vaigyanik Protsahan Yojana (KVPY) is an on-going National Program of Fellowship in Basic Sciences, initiated andfunded by the Department of Science and Technology, Government of India, to attract exceptionally highly motivated students for pursuing basic science courses and research career in science. Generous fellowship and contingency grant are provided to the selected KVPY Fellows up to the pre Ph.D. level or 5 years whichever is earlier. KVPY can be written by students from class 11th and 12th.KVPY is considered to be the best scholarships for school students.'),
(4, 'Young Indian Challenge for School Students', 'http://www.jwfiles.net/2015/03/young-india-challenge-for-school.html', 'This is a scholarship for students in their 8th-12th standard. The cash prize is of the amount Rs. 20,000. The selection process involves weekly writing challenges that one must enroll in. The winners of all the weekly challenges compete in the finals, whose final performance will be judged by top industry mentors.'),
(5, 'Foundation For Academic Excellence and Access (FAEA)', 'http://www.faeaindia.org/', 'FAEA provides scholarships for students belonging to socially and economically disadvantaged sections of the society. It enables students to study in the institutions, which provide academic excellence and economic opportunity. Students are selected on the basis of their academic excellence and social and economic background. Scholarship Program will provide support to the students selected for up to three years in the first instance. This can be extended for another two years for postgraduate study. All the permanent resident Indian students who have passed 12th grade are eligible for this scholarship.'),
(6, 'Pre-Metric Scholarship for Minority Students', 'http://www.minorityaffairs.gov.in/prematric', 'This is a scholarship for minority students in standards 1-10th. Here, minority status is given to Muslim/ Christian/ Sikh/ Buddhist/ Parsicommunities where the students parents income is less than Rs. 1 lakh annually. The total scholarship amount comes annually to about Rs. 3,000-6,000.'),
(7, 'Post-Matric Scholarship for Minority Communities', 'http://www.minorityaffairs.gov.in/Postmetric/', 'This is the corresponding scholarship for minorities in standards 11th, 12th. The classification remains the same for the minority status. The scholarship is Rs. 7,000-12,000 annually.'),
(8, 'Tata Building India School English Essay Competition', 'http://tatabuildingindia.com/New-Site/', 'The Tata Building India School English Essay Competition, one of Indias largest essay competitions is an initiative to motivate the youth of India in nation building. The competition opens with the first step to contribute on a host of subjects related to nation building. The winners are awarded exciting prizes from handycams and digital cameras to laptops and trophies. Students of class 6th to 12th grade are eligible for this exam.Knowledge of current affairs and writing skills is a must. The essay topics are carefully chosen to allow students to be creative, insightful and genuine.');

